import React from "react";

export default function Home() {
  return (
    <div className="text-center py-20">
      <h1 className="text-4xl font-bold text-gray-800 mb-4">Welcome to DocuManage</h1>
      <p className="text-gray-600 text-lg">Securely upload and manage your documents with ease.</p>
    </div>
  );
}
